    setCount(() => e.target.value);
  }

    return (
      <>
        {count}
        <h3>{placehold}</h3>
        <FloatingLabel controlId="floatingTextarea2" label={placehold}>
          <Form.Control
            as="textarea"
            placeholder="vsefvsdvfs"
            style={{ height: h }}
            value={count}
            onChange={countHandler}
            name
          />
        </FloatingLabel>
      </>
    );
}
